import React from 'react';

function Register() {
    return(
        <div>
            <Header>
                <a href="/sign-in" className="header__link">Войти</a>
            </Header>
            <form name="main-form" action="#" className="main-form" noValidate>
                <h2 className="main-form__title">Регистрация</h2>
                <input type="text" name="email" className="main-form__input" placeholder="Email"/>
                <input type="password" name="password" className="main-form__input" placeholder="Пароль"/>
                <button type="submit" name="submit" className="main-form__button">Зарегистрироваться</button>
                <a href="/sign-in" className="main-form__link">Уже зарегистрированы? Войти</a>
            </form>
        </div>
        );
}

export default Register;
